    if(node.startNode == true) {
        points.startNode = node
    }
    else if(node.endNode == true) {
        points.endNode = node
    }
    return points
}

function getNodes(grid) {
    const nodes = []
    for (let row of grid) {
        const currRow = []
        for(var node of row) {
            const currNode = node
            currRow.push(currNode)
            node.startNode ? () => getPoints(node) : (node.endNode ? () => getPoints(node) : null)
        }
        nodes.push(currRow)
    }
    return nodes 
}

